import React, {Component} from 'react';

class NavBar extends Component {
    render() {
        return (
            <div>
                <nav className="navbar navbar-light bg-light">
                    <a className="navbar-brand" href="#">Navbar
                        
                    </a>
                </nav>
            </div>
        );
    }
}

NavBar.propTypes = {};
export default NavBar;
